using HtmlAgilityPack;\nusing System;\nusing System.Collections.Generic;\n\nclass Program\n{\n    static void Main()\n    {\n        string html = "<html><body><a href='http://example.com'>Example</a><a href='http://example2.com'>Example2</a></body></html>";\n\n        List<string> links = GetLinksFromHtml(html);\n\n        foreach (var link in links)\n        {\n            Console.WriteLine(link);\n        }\n    }\n\n    static List<string> GetLinksFromHtml(string html)\n    {\n        var links = new List<string>();\n        var htmlDoc = new HtmlDocument();\n        htmlDoc.LoadHtml(html);\n\n        foreach (var link in htmlDoc.DocumentNode.SelectNodes("//a[@href]"))\n        {\n            HtmlAttribute att = link.Attributes["href"];\n            if (att != null)\n            {\n                links.Add(att.Value);\n            }\n        }\n\n        return links;\n    }\n}